slice::<impl [T]>::last.doc:
Returns the last element of the slice, or `None` if it is empty.

# Examples

```
let v = [10, 40, 30];
assert_eq!(Some(&30), v.last());

let w: &[i32] = &[];
assert_eq!(None, w.last());
```

